import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search.png'));

    // Wait for the product card to appear and click on the first product
    await page.waitForSelector('.product-card');
    await page.click('.product-card');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_clicked_first_product.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_clicked_first_product.png'));

    // Click the add to cart button
    await page.waitForSelector('.add-to-cart');
    await page.click('.add-to-cart');
    await page.waitForTimeout(1000); // Wait for the action to complete
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_cart.png'));

    // Verify if the product was added to the cart
    const cartCount = await page.textContent('.cart-count');
    const success = parseInt(cartCount) > 0;

    return {
      success,
      action: "Added the first product to the cart",
      extractedData: { cartCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
